\[
\frac{1}{\cos^2 10^\circ} + \frac{1}{\sin^2 20^\circ} + \frac{1}{\sin^2 40^\circ} = 1 + \tan^2 10^\circ + \frac{1}{\sin^2 20^\circ} + \frac{1}{\sin^2 40^\circ}
\]

However, a more straightforward approach is to use the identity involving the sum of the reciprocals of the squares of the sines of angles in arithmetic progression. Specifically, we use the identity:

\[
\frac{1}{\sin^2 x} + \frac{1}{\sin^2 (60^\circ - x)} + \frac{1}{\sin^2 (60^\circ + x)} = 8
\]

In our problem, we can set \(x = 20^\circ\). Then the angles are \(20^\circ\), \(40^\circ\), and \(80^\circ\), but we need to express \(80^\circ\) in terms of \(60^\circ - x\) and \(60^\circ + x\). Notice that \(80^\circ = 60^\circ + 20^\circ\), but we can use the identity for \(80^\circ\) in a different way by considering the relationship between the angles.

 instead, we can use the identity in a different form. Let's use the identity for the sum of the reciprocals of the squares of the sines of angles in the form \(x\), \(2x\), and \(4x\) where \(x = 10^\circ\):

